(3, '<p style=\"line-height: 200%;\"><span style=\"color: rgb(51, 102, 255); font-size: 24px; font-weight: bold;\">Lesson 1: Making Generalization</span><span style=\"color: rgb(51, 102, 255); vertical-align: super; font-size: 24px; font-weight: bold;\"></span></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<div style=\"text-align: center;\"><img style=\"max-width: 80%; height: 312px;\" src=\"data:image/png;base64,\" /></div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: center;\"><br /></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<div style=\"text-align: left; line-height: 150%;\"><span style=\"font-weight: bold; font-size: 18px;\"><span style=\"color: rgb(51, 102, 255); font-size: 24px;\">Introduction</span></span></div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: left; line-height: 150%;\">Since communication can be verbal and nonverbal, we are provided with more means of\r\ngiving and receiving meaning or information. Some implied or suggested messages, which\r\nare presented through nonverbal cues, are helpful in understanding speakers or\r\ncollocutors. Making generalizations, the focus of this lesson, is like interpreting nonverbal\r\ncommunication since it helps us critically think about certain contexts and situations to\r\nunderstand others and to be understood.</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: left; line-height: 150%;\"><br /></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: left; line-height: 150%;\"><span style=\"color: rgb(51, 102, 255); font-size: 24px; font-weight: 700;\">Objectives</span></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"line-height: 200%;\">In this lesson, you should be able to do the following:</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<ol><li><p>\r\n\r\nMake generalizations, particularly about songs, poems, and other\r\nlistening texts.</p></li><li><p>\r\n\r\nDistinguish between the different categories of generalizations.\r\n\r\n<br /></p></li><li><p>\r\n\r\nFormulate generalizations from various text types.</p></li></ol>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><br /></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><span style=\"color: rgb(51, 102, 255); font-size: 24px; font-weight: 700;\">Warm-Up</span></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><span style=\"color: rgb(255, 102, 0); font-weight: bold; font-size: 16px;\">Think - Pair - Share</span></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<div style=\"text-align: center;\"><img style=\"max-width: 80%; height: 270px;\" src=\"data:image/png;base64,\" /></div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: left;\"><br /></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>\r\n\r\n<span style=\"color: rgb(51, 102, 255); font-size: 24px; font-weight: 700\">Procedure</span><br /></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>1.&nbsp;\r\n\r\nWith a partner, read the following statements:\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><img src=\"data:image/png;base64,\" style=\"max-width: 80%; height: 204px;\" /></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>\r\n\r\n2. In the second column, discuss what you think of the statements read.&nbsp;</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>3. After the discussion, answer the following guide questions:&nbsp;</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;a. How did you come up with an answer in the second column?&nbsp;</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;b. What did you focus on in coming up with these answers?\r\n\r\n<br /></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><br /></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><br />\r\n\r\n<span style=\"color: rgb(51, 102, 255); font-size: 24px; font-weight: 700\">Learn about it</span></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<div style=\"text-align: left;\">&nbsp;&nbsp;<img style=\"max-width: 80%; height: 356px;\" src=\"data:image/png;base64,\" /></div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><br /></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><br /><span style=\"color: rgb(255, 102, 0); font-weight: 700; font-size: 18px;\">Making Generalizations</span></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>\r\n\r\nA generalization is a statement that presents a conclusion drawn only from a small amount\r\nof information.\r\n\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>\r\n\r\n<span style=\"color: rgb(51, 102, 255); font-weight: bold;\">Characteristics of Generalizations</span>\r\n\r\n<br /></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>\r\n\r\n&nbsp;&nbsp;&nbsp;&nbsp;a. It asserts that a statement is true in general.&nbsp;</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;b. Often, generalizations use keywords such as all, everyone, no one, some, most, or\r\nnone.&nbsp;</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;c. A generalization may be valid or invalid. A generalization is valid if it is supported by\r\nfacts.&nbsp;</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;It is considered faulty or invalid if it can be disproven or if it is not supported by\r\nfacts.</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>\r\n\r\n<span style=\"color: rgb(51, 102, 255)\"><span style=\"font-weight: bold;\">\r\n\r\n<span style=\"color: rgb(51, 102, 255);\">Characteristics of Generalizations</span></span>\r\n</span><br /></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>\r\n\r\nGeneralizations fall under the following categories:\r\n\r\n<br /></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"font-weight: bold;\">\r\n\r\na. Universal generalization</span>&nbsp;</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;This kind of generalization claims that all the members of a particular group share\r\nthe same certain attributes or characteristics.</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<div style=\"text-align: left;\">&nbsp;&nbsp;&nbsp;&nbsp;<img style=\"max-width: 80%; height: 107px;\" src=\"data:image/png;base64,\" /></div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p style=\"text-align: left;\"><br /></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>\r\n\r\n&nbsp;&nbsp;&nbsp;&nbsp;In the given examples, notice the underlined words. Everybody, all, and every,\r\namong others,&nbsp;</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;suggest that the entire population was taken as one.&nbsp;</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;Therefore,\r\nthese statements suggest a universal generalization.\r\n<br /></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>\r\n\r\n&nbsp;&nbsp;<span style=\"font-weight: bold;\">&nbsp;&nbsp;b. Statistical generalization</span>&nbsp;</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;This kind of generalization makes a claim that a percentage or part of a group\r\nshares a certain attribute or characteristic.\r\n\r\n<br /></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;<img src=\"data:image/png;base64,\" style=\"max-width: 80%; height: 80px;\" /></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>&nbsp; &nbsp; &nbsp;<img src=\"data:image/png;base64,\" style=\"max-width: 80%; height: 45px;\" /></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>\r\n\r\n&nbsp;&nbsp;&nbsp;&nbsp;The given statements contain a statistical fact that supports the generalization\r\ntoward&nbsp;</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;the portion of the population the context is concerned with.&nbsp;</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;In the first\r\nexample, eight out of ten fans suggests that a number of the population supports\r\ntheir product.&nbsp;</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;Most also suggests the same notion.\r\n\r\n<br /></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>\r\n\r\n<span style=\" font-weight: bold\">&nbsp;&nbsp;&nbsp;&nbsp;b. Contingent generalization</span><br /></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><span style=\"font-weight: bold;\">&nbsp;&nbsp;&nbsp;&nbsp;</span>\r\n\r\nThis kind of generalization is based on conditions or qualifications that need to be\r\nmet for the generalization to be considered true.&nbsp;</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Often, a generalization of this\r\nkind mentions a particular time, place, or situation.</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n<div style=\"text-align: left;\">&nbsp;&nbsp;&nbsp;&nbsp;<img style=\"max-width: 80%; height: 70px;\" src=\"data:image/png;base64,\" /></div>\r\n\r\n\r\n\r\n\r\n<p>\r\n\r\n&nbsp;&nbsp;&nbsp;&nbsp;In the first example, “Holy Week” was taken as the situation that the generalization is\r\nbased on.&nbsp;</p>\r\n\r\n\r\n\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;In the second sentence, the clause “when we feel the need to relax” is the\r\ncondition given.\r\n<br /></p>\r\n\r\n\r\n<p><br /></p>\r\n\r\n\r\n\r\n\r\n<p>\r\n\r\nBelow are some guide questions that will help you come up with your own generalizations\r\nwhen reading or listening to a particular text:\r\n\r\n<br /></p>\r\n\r\n\r\n\r\n\r\n<p>\r\n\r\n1. What is the topic being discussed?&nbsp;</p>\r\n\r\n\r\n\r\n\r\n<p>2. What are the similarities among the details in the text?&nbsp;</p>\r\n\r\n\r\n\r\n\r\n<p>3. What general idea will cover the points made by the author in the text?&nbsp;</p>\r\n\r\n\r\n\r\n\r\n<p>4. What are the characteristics shared by the texts written by a certain author?\r\n\r\n<br /></p>\r\n\r\n\r\n<p><br /></p>\r\n\r\n\r\n<p><br /></p>\r\n\r\n\r\n<div style=\"text-align: left;\"><img style=\"max-width: 80%; height: 91px;\" src=\"data:image/png;base64,\" /></div>\r\n\r\n\r\n<p style=\"text-align: left;\"><br /></p>\r\n\r\n\r\n<div style=\"text-align: left;\"><img style=\"max-width: 80%; height: 181px;\" src=\"data:image/png;base64,\" /></div>\r\n<p><br /></p>\r\n<div style=\"text-align: left;\"><img style=\"max-width: 80%; height: 517px;\" src=\"data:image/png;base64,\" /></div>', 1, 3, '2023-11-24 14:26:06');
INSERT INTO `lesson_content` (`content_id`, `content_body`, `num_order`, `lesson_id`, `content_date_added`) VALUES
(4, '<p style=\"line-height: 100%;\"><span style=\"color: rgb(51, 102, 255); font-size: 24px; font-weight: bold;\">Lesson 2:&nbsp;Common Elements and Themes in\r\nGreek Mythology</span></p>\r\n\r\n\r\n\r\n\r\n<p><br /></p>\r\n\r\n\r\n\r\n\r\n<div style=\"text-align: center;\"><img style=\"max-width: 80%; height: 395px;\" src=\"data:image/png;base64,\" /></div>\r\n\r\n\r\n\r\n\r\n<h2><span style=\"color: rgb(51, 102, 255); font-size: 18px;\">Introduction</span></h2>\r\n\r\n\r\n\r\n\r\n<p>\r\n\r\nThe elements of Greek mythology are similar to those of a narrative. Each story in Greek\r\nmythology has characters, setting, plot, and theme(s). In this lesson, you will learn about\r\nthese common elements and themes.\r\n<br /></p>\r\n\r\n\r\n\r\n\r\n<p>\r\n\r\n</p>\r\n\r\n\r\n\r\n\r\n<h2><span style=\"color: rgb(51, 102, 255); font-size: 18px;\">Objective</span></h2>\r\n\r\n\r\n\r\n\r\n<p><span style=\"color: rgb(51, 102, 255);\">\r\n\r\n<span style=\"color: rgb(0, 0, 0);\">In this lesson, you should be able to determine common elements in other\r\npopular Greek myths.</span></span></p>\r\n\r\n\r\n<h2><span style=\"color: rgb(51, 102, 255); font-size: 18px;\">Warm-Up</span></h2>\r\n\r\n\r\n<p><span style=\"font-size: 18px; color: rgb(255, 0, 0);\">Quad Activity</span></p>\r\n\r\n\r\n<p><span style=\"color: rgb(51, 102, 255); font-size: 18px;\">Procedure</span></p>\r\n\r\n\r\n\r\n\r\n<p><br /></p>\r\n\r\n\r\n<ol><li> groups of four.</li><li>The following box contains some elements and themes in Greek mythology.</li><li>Find all 12 words.</li><li>Share your answers in class.&nbsp; &nbsp; &nbsp; &nbsp;</li></ol>\r\n\r\n\r\n<div style=\"text-align: center;\"><img style=\"max-width: 80%; height: 370px;\" src=\"data:image/png;base64,\" /></div>\r\n\r\n\r\n<p><br /></p>\r\n\r\n\r\n<p>\r\n\r\n<span style=\"color: rgb(51, 102, 255); font-size: 18px\">Guide Questions</span><br /></p>\r\n\r\n\r\n<p>&nbsp; &nbsp; 1.&nbsp;\r\n\r\nCite an example of a Greek myth that shares one of the themes that you identified.</p>\r\n\r\n\r\n<p>&nbsp; &nbsp; 2.&nbsp;\r\n\r\nCite an example of a Philippine myth that shares one of the themes that you\r\nidentified.</p>\r\n\r\n\r\n<p><br /></p>\r\n\r\n\r\n<p>\r\n\r\n<span style=\"color: rgb(51, 102, 255); font-size: 18px\">Learn about it</span><br /></p>\r\n\r\n\r\n<p><br /></p>\r\n\r\n\r\n<div style=\"text-align: center;\"><img style=\"max-width: 80%; height: 130px;\" src=\"data:image/png;base64,\" /></div>\r\n\r\n\r\n<div style=\"text-align: center;\"><img style=\"max-width: 80%; height: 229px;\" src=\"data:image/png;base64,\" /></div>\r\n\r\n\r\n<p style=\"text-align: left;\"><br /></p>\r\n\r\n\r\n<p style=\"text-align: left;\"><span style=\"color: red; font-size: 18px;\">\r\n\r\nElements in Greek Mythology\r\n\r\n</span><br /></p>\r\n\r\n\r\n<p style=\"text-align: left;\">\r\n\r\nIt is notable that in Greek mythology, stories always involved characters who are gods and\r\ngoddesses, heroes, or mythical beings.\r\n\r\n<br /></p>\r\n\r\n\r\n<p style=\"text-align: left;\">\r\n\r\nThe setting for most Greek myths is ancient Greece, although there are some that are set in\r\nMount Olympus or other fictional and mythical places such as the underworld.\r\n\r\n<br /></p>\r\n\r\n\r\n<p style=\"text-align: left;\">\r\n\r\nThe plot of most of these stories has a distinct beginning, middle, and end, although some\r\nstories are interrelated.\r\n\r\n<br /></p>\r\n\r\n\r\n<p style=\"text-align: left;\">\r\n\r\nThemes are universal ideas in a literary work (i.e., fate, revenge, reward for goodness and\r\npunishment for evil, etc.), while motifs are recurring structures that help develop the theme\r\n(e.g., beauty, love).\r\n\r\n<br /></p>\r\n\r\n\r\n<p style=\"text-align: left;\"><br /></p>\r\n\r\n\r\n<p>\r\n\r\n<span style=\"color: rgb(255, 0, 0); font-size: 18px; text-align: left\">Themes in Greek Mythology</span><br /></p>\r\n\r\n\r\n\r\nVarious themes and motifs present in Greek mythology include the following:\r\n\r\n\r\n<p>&nbsp; &nbsp; 1.&nbsp;\r\n\r\n<span style=\"font-weight: bold;\">Fate</span> – Many characters in Greek mythology attempt to alter their fate, but all their\r\nattempts always end up being futile. In the stories, the attempt of a character to&nbsp;\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\nchange his destiny only leads to the fulfillment of the prophecy. This is because of\r\nthe three Fates, Clotho, Lachesis, and Atropos, who controlled the destiny of &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;both men and gods alike.\r\n<br /></p>\r\n\r\n\r\n<p>&nbsp; &nbsp; 2.&nbsp;\r\n\r\n<span style=\"font-weight: bold;\">Reward for goodness and punishment for evil</span> – In Greek mythology, gods or\r\ngoddesses judge the actions of men and reward or punish them accordingly.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Mortals\r\nare punished for their pride, arrogance, and/or disobedience. Those who challenge\r\nor disobey the gods are made to suffer; they may have to endure &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;eternal\r\npunishment, be transformed into monsters, or turned into natural phenomena.\r\n\r\n<br /></p>\r\n\r\n\r\n<p>&nbsp; &nbsp; 3.&nbsp;\r\n\r\n<span style=\"font-weight: bold;\">Love </span>– Many stories in Greek mythology involve love, but love is treated in a different\r\nway from our modern-day notions of love. In Greek myths, love is often &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;unrequited\r\nand also often ends in tragedy. When love forms between mortals and gods, it rarely\r\nworks out. Some stories also depict one party as loving strongly &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(often the woman)\r\nonly to be left by her lover later on.<br /></p>\r\n\r\n\r\n<p>&nbsp; &nbsp; 4.&nbsp;\r\n\r\n<span style=\"font-weight: bold;\">War</span> – In Greek myths, war is depicted as an inevitable part of existence, and it is\r\nconsidered an honor to die while fighting in war. Gods and goddesses also often &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;take\r\nsides and get themselves involved in conflicts between mortals.</p>\r\n\r\n\r\n<p>&nbsp; &nbsp; 5.&nbsp;\r\n\r\n<span style=\"font-weight: bold;\">Vengeance</span> – Many Greek myths feature characters who avenge themselves or their\r\nloved ones. This leads to even more bloodshed, as bloodshed begets &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;bloodshed.\r\n\r\n&nbsp;&nbsp;</p>\r\n\r\n\r\n<p>&nbsp; &nbsp; 6.&nbsp;<span style=\"font-weight: bold;\">\r\n\r\nBeauty</span> – The idea that being beautiful is better is evident in Greek myths since the\r\nGreeks valued beauty and perfection. However, beauty causes trouble in Greek\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;mythology. This can be seen in the stories of Narcissus as well as in the story of\r\nHelen of Troy.</p>\r\n\r\n\r\n<p><br /></p>\r\n\r\n\r\n<div style=\"text-align: left;\"><img style=\"max-width: 80%; height: 108px;\" src=\"data:image/png;base64,\" /></div>\r\n\r\n\r\n<p style=\"text-align: left;\"><br /></p>\r\n\r\n\r\n<div style=\"text-align: left;\"><img style=\"max-width: 80%; height: 197px;\" src=\"data:image/png;base64,\" /></div>\r\n\r\n\r\n<p><img src=\"data:image/png;base64,\" style=\"max-width: 80%; height: 454px;\" /></p>', 1, 4, '2023-12-07 08:34:44');

