(2, 2, '<p>What valid generalization can you make from the image presented below?</p>\r\n<div style=\"text-align: left;\"><img style=\"max-width: 80%; height: 204px;\" src=\"data:image/png;base64,\" /></div>', 'People are protesting to fight for the rights of the black.', 'Only those who are exceptionally brave among people can fight against injustice.', 'Heroic people risk their lives to save others.', 'Nobody cares about his/her life.', 'People are protesting to fight for the rights of the black.', 'The fight for civil rights is ongoing.', 'unity hand.png', 'People of all races are fighting for equality.', 1);
