en I\r\nenter my home, she races to greet me with kisses and&nbsp;&nbsp; excited leaps. She acts like it’s been eight\r\ndays since she’s seen me, instead of the actual eight hours. Her coat is honey\r\nborn; her eyes are large and loving.</span></p>\r\n\r\n\r\n<p><span style=\"font-weight: bold; font-style: italic;\">&nbsp;&nbsp;&nbsp;&nbsp;She’s a six-month old spaniel puppy, a\r\nbreed originally intended to hunt birds in England. Her faithful companionship\r\ncomforts me when I’m sad or sick. Her playfulness makes me laugh when she races\r\nafter a toy I’ve tossed. All spaniels make perfect pets\"</span></p>\r\n\r\n\r\n<p><span style=\"font-weight: bold;\">\r\n\r\n<b style=\"text-align: justify;\"><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman=\"\" serif=\"\">For items 5 and 6, read&nbsp;the&nbsp;text above.&nbsp;</span></b>\r\n<br /></span></p>\r\n\r\n\r\n<p>\r\n\r\n\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n<meta name=\"ProgId\" content=\"Word.DocumentW\" />\r\n<meta name=\"Generator\" content=\"Microsoft Word 15\" />\r\n<meta name=\"Originator\" content=\"Microsoft Word 15\" />\r\n<link rel=\"File-List\r\n\" href=\"file:///C:/Users/User/AppData/Local/Packages/oice_16_974fa576_32c1d314_b98/AC/Temp/msohtmlclip1/01/clip_filelist.xml\" />\r\n<link rel=\"themeData\r\n\" href=\"file:///C:/Users/User/AppData/Local/Packages/oice_16_974fa576_32c1d314_b98/AC/Temp/msohtmlclip1/01/clip_themedata.thmx\" />\r\n<link rel=\"colorSchemeMapping\r\n\" href=\"file:///C:/Users/User/AppData/Local/Packages/oice_16_974fa576_32c1d314_b98/AC/Temp/msohtmlclip1/01/clip_colorschememapping.xml\" />\r\n<xml style=\"font-weight: bold; font-style: italic;\">\r\n \r\n  </xml></p>\r\n<p style=\"margin: 0in 0in 8pt 0.25in; text-align: justify; text-indent: -0.25in;\"><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman=\"\" serif=\"\">What&nbsp;generalization&nbsp;is&nbsp;found&nbsp;in&nbsp;the&nbsp;passage?&nbsp;</span></p>', 'All spaniels make perfect pets.', 'Spaniel is a six-month old puppy.', 'Spaniel is a breed originally intended to hunt birds in England.', 'Spaniel is Ginger’s best friend.', 'All spaniels make perfect pets.', 'A loyal and loving canine companion.', 'ikog.png', 'Great friends for humans.', 1),
(6, 6, '<p>\r\n\r\n</p>\r\n<p style=\" margin-bottom: 8pt; text-align: justify\"><span style=\"font-style: italic; font-weight: bold\">\"Ginger is one of my best friends. When I enter my home, she races to greet me with kisses and&nbsp;&nbsp; excited leaps. She acts like it’s been eight days since she’s seen me, instead of the actual eight hours. Her coat is honey born; her eyes are large and loving.</span></p>\r\n<p><span style=\"font-weight: bold; font-style: italic\">&nbsp;&nbsp;&nbsp;&nbsp;She’s a six-month old spaniel puppy, a breed originally intended to hunt birds in England. Her faithful companionship comforts me when I’m sad or sick. Her playfulness makes me laugh when she races after a toy I’ve tossed. All spaniels make perfect pets\"</span></p>\r\n<p><span style=\"font-weight: bold\"><b style=\"text-align: justify\"><span style=\"font-size: 12pt\">For items 5 and 6, read&nbsp;the&nbsp;text above.&nbsp;</span></b></span></p>\r\n<p><span style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">\r\n\r\n\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n<meta name=\"ProgId\" content=\"Word.DocumentW\" />\r\n<meta name=\"Generator\" content=\"Microsoft Word 15\" />\r\n<meta name=\"Originator\" content=\"Microsoft Word 15\" />\r\n<link rel=\"File-List\r\n\" href=\"file:///C:/Users/User/AppData/Local/Packages/oice_16_974fa576_32c1d314_b98/AC/Temp/msohtmlclip1/01/clip_filelist.xml\" />\r\n<link rel=\"themeData\r\n\" href=\"file:///C:/Users/User/AppData/Local/Packages/oice_16_974fa576_32c1d314_b98/AC/Temp/msohtmlclip1/01/clip_themedata.thmx\" />\r\n<link rel=\"colorSchemeMapping\r\n\" href=\"file:///C:/Users/User/AppData/Local/Packages/oice_16_974fa576_32c1d314_b98/AC/Temp/msohtmlclip1/01/clip_colorschememapping.xml\" />\r\n<xml style=\"\">\r\n \r\n    \r\n   \r\n   \r\n   \r\n   \r\n   \r\n   \r\n   \r\n   \r\n   \r\n   \r\n  \r\n  \r\n  \r\n   \r\n   \r\n   \r\n   \r\n   \r\n   \r\n   \r\n   \r\n   \r\n   \r\n   \r\n  \r\n</x