\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n \r\n</xml>\r\n<style>\r\n\r\n</style>\r\n\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\r\n	mso-para-margin:0in;\r\n	mso-pagination:widow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:\"Times New Roman\",serif;}\r\n</style>\r\n\r\n\r\n\r\n\r\n<span style=\"font-size: 12pt; line-height: 115%; font-family: &quot;Times New Roman&quot;, serif;\">How does&nbsp;the&nbsp;author support her ideas?</span></span></span></p>', 'The author supports it by facts.', 'The author expresses her own opinions.', 'The author uses logic and reasoning.', 'The author proves it with several examples.', 'The author proves it with several examples.', 'substantiates her claims with a wealth of supporting evidence.', 'about the author.jpg', 'provides numerous illustrations ', 1),
(7, 7, '<p>How do you make a valid generalization? <br /></p>', 'We make valid generalization by using logic and reasoning.', 'We make valid generalization by proving it with one example only.', 'We make valid generalization by using different key words.', 'We make valid generalization by not supporting it with facts.', 'We make valid generalization by using logic and reasoning.', 'Drawing conclusions based on facts and evidence.', 'logical.jpg', 'logical principles to connect ideas', 1),
(8, 8, '<p>What is faulty with this generalization? <br /></p>\r\n<p><span style=\"font-weight: bold; font-style: italic;\">\"Chocolate\r\nis everyone’s favorite dessert.\"</span></p>', 'The speaker in the sentence claims that chocolate is loved by everyone which is not proven with evidence.', 'The speaker is expressing his/her own opinions.', 'The speaker uses logic and reasoning.', 'The speaker supports his/her ideas with facts.', 'The speaker in the sentence claims that chocolate is loved by everyone which is not proven with evidence.', 'absolute statement that cannot be proven or disprove.', 'no chocholate.jpg', 'not providing any evidence to support their claim.', 1),
(9, 9, '<p>\r\n\r\n\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n<meta name=\"ProgId\" content=\"Word.DocumentW\" />\r\n<meta name=\"Generator\" content=\"Microsoft Word 15\" />\r\n<meta name=\"Originator\" content=\"Microsoft Word 15\" />\r\n<link rel=\"File-List\r\n\" href=\"file:///C:/Users/User/AppData/Local/Packages/oice_16_974fa576_32c1d314_b98/AC/Temp/msohtmlclip1/01/clip_filelist.xml\" />\r\n<link rel=\"themeData\r\n\" href=\"file:///C:/Users/User/AppData/Local/Packages/oice_16_974fa576_32c1d314_b98/AC/Temp/msohtmlclip1/01/clip_themedata.thmx\" />\r\n<link rel=\"colorSchemeMapping\r\n\" href=\"file:///C:/Users/User/AppData/Local/Packages/oice_16_974fa576_32c1d314_b98/AC/Temp/msohtmlclip1/01/clip_colorschememapping.xml\" />\r\n<xml>\r\n \r\n  </xml></p>\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:\r\n8.0pt;margin-left:.25in;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:-.25in\"><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif\">What is the general idea in the paragraph\r\nbelow?</span></p>\r\n<p style=\"margin: 0in 0in 8pt 0.25in; text-align: justify; text-indent: -0.25in; line-height: 100%;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; font-style: italic; font-weight: bold;\">\"Man has always wanted\r\nto improve his appearance. Early man put on animal skins and hung strings of\r\nbeads and stones around his neck.</span></p>\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:\r\n8.0pt;margin-left:.25in;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:-.25in\"><span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 12pt; text-indent: -0.25in; font-style: italic; font-weight: bold;\">He decorated himself with paint, tattoos, and\r\nscars. Bark, leaves, straw, feathers, or whatever materials were closest at\r\nhand were turned into clothing.\"</span></p>\r\n\r\n\r\n\r\n\r\n<br />', 'He decorated himself with paint, tattoos, and scars.', 'Early man put on animal skins and hung strings of beads and stones around his neck.', 'Man wants to improve his appearance. ', 'Bark, leaves, straw, feathers, or whatever materials were closest at hand were turned into clothing.', 'Man wants to improve his appearance. ', 'Focusing on physical attributes', 'man cannot focus.png', 'Emphasizing style and fashion', 1),
(10, 10, '<p>What general idea could you draw from the\r\npassage below?<br /></p>\r\n<p>\r\n\r\n\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n<meta name=\"ProgId\" content=\"Word.DocumentW\" />\r\n<meta name=\"Generator\" content=\"Microsoft Word 15\" />\r\n<meta name=\"Originator\" content=\"Microsoft Word 15\" />\r\n<link rel=\"File-List\r\n\" href=\"file:///C:/Users/User/AppData/Local/Packages/oice_16_974fa576_32c1d314_b98/AC/Temp/msohtmlclip1/01/clip_filelist.xml\" />\r\n<link rel=\"themeData\r\n\" href=\"file:///C:/Users/User/AppData/Local/Packages/oice_16_974fa576_32c1d314_b98/AC/Temp/msohtmlclip1/01/clip_themedata.thmx\" />\r\n<link rel=\"colorSchemeMapping\r\n\" href=\"file:///C:/Users/User/AppData/Local/Packages/oice_16_974fa576_32c1d314_b98/AC/Temp/msohtmlclip1/01/clip_colorschememapping.xml\" />\r\n<span style=\"font-weight: bold; font-style: italic;\"><xml></xml><xml></xml><style>\r\n\r\n</style><style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\r\n	mso-para-margin:0in;\r\n	mso-pagination:widow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:\"Times New Roman\",serif;}\r\n</style><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif\">\"In 1928, Amelia Earhart became the first woman\r\nto cross the Atlantic Ocean as a passenger in an airplane. In 1932, she became\r\nthe first woman pilot to fly solo across the Atlantic. Later that year, she was\r\nthe first woman to fly the United States from New Jersey to California. Earhart\r\nset records in flying times and won many awards.\"</span></span><br /></p>\r\n<p><span style=\"font-size: 9px;\">(taken\r\nfrom All About the USA)&nbsp;</span>&nbsp;</p>\r\n<p><span style=\"font-size: 9px;\">&nbsp;Source:https://www.google.com/url?sa=t&amp;source=web&amp;rct=j&amp;url=http://repository.ut.ac.id/3806/1/PBIS4208-M1.pdf&amp;ved=2ahUKEwjP-uGBoL3uAhUQrpQKHYmPD-MQFjAAegQIARAB&amp;usg=AOvVaw2YOgQIn2vrf1_aD3dHro9r</span><br /></p>', 'Amelia Earhart was a famous woman in her time.', 'Amelia Earhart barely achieved anything during her time.', 'Amelia Earhart failed to achieve her dream.', 'Amelia Earhart was an inspiration for all.', 'Amelia Earhart was a famous woman in her time.', 'Captivating persona and adventurous spirit', 'you can see the back of the woman.png', 'Well known woman on her day.', 1);

